import styled from 'styled-components/macro';

export const card = styled.div `
    display: flex;
    color: white;
    padding: 5px 10px;
`

export const ContentBlock = styled.div`
    position: relative;
    flex: calc(18vw - 4px);
    flex-shrink: 0;
    height: 9.5vw;
    margin-right: 4px;
    display: flex;
`
